import React, { Component } from "react";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

// import "./icon.css";

const icons = {
  HTML: "fab fa-html5"
};

export default class icon extends Component {
  render() {
    const { icon } = this.props;
    return icons[icon] ? (
      <FontAwesomeIcon icon={icons[icon]} />
    ) : (
      <span>{icon}</span>
    );
  }
}
